import React from 'react';
import { Link } from 'react-router-dom';
import './buttonPurchase.css';

export default function ButtonPurchase() {
    const cleaner = () => {
        document.location = '/purchase'
    }

    return (
        <div className='button'>
            <Link to="/purchase"></Link>
            <button
                onClick={cleaner}
                disabled>
                    Purchase
                </button>
        </div>

    )
}
